import React from 'react';
import {
    BrowserRouter as Router,
} from "react-router-dom";

import Background from './components/background.js'
import Main from './Main'
import './App.scss';

class App extends React.Component {
    render() {
        return <>
            <Background />
            <Router>
                <div id="main">
                <div id="header">
                    <div id="presentation">
                        <h1>Societatea Română de Științe Informatice</h1>
                    </div>
                    <div id="navbar">
                        <Link className="Navitem" to="/despre-noi">Despre Noi</Link>
                        <Link className="Navitem" to="/articole">Evenimente</Link>
                        <Link className="Navitem" to="/blog">Blog</Link>
                        <Link className="Navitem" to="/contact">Contact</Link>
                    </div>
                </div>
            </div>
            </Router>
        </>
    }
}

export default App;
